        scales: {
            yAxes: [
                {
                    ticks: {
                        beginAtZero: true,
                    },
                },
            ],
        },
    }
    return (
        <div className="my-5">
            <Bar data={data} title='Stock status' options={options} />
        </div>
    );
}

export default ChartTry;
